import {contexto} from './theme-context';

class Botao extends React.Component {
  render() {
    let props = this.props;
    let theme = this.context;
    return (
      <button
        {...props}
        style={{backgroundColor: theme.background}}
      />
    );
  }
}
Botao.contextType = contexto;

export default Botao;
